import homecity from '../assets/homecity.jpg'
import villa from '../assets/villa.jpg'
import vince from '../assets/vince.jpg'

const websiteList = [
  {
    image: homecity,
    label: 'homecity'
  },
  {
    image: villa,
    label: 'villa'
  },
  {
    image: vince,
    label: 'vince'
  }
]

export default websiteList;
